import React from 'react'

const brands = [
  { id: 1, brand: 'puma' },
  { id: 2, brand: 'addidas' },
  { id: 3, brand: 'reebok' },
  { id: 4, brand: 'nike' },
  { id: 5, brand: 'puma' },
]

function ExerciseBrandFilter() {
  return (
    <div>
      <h1>{brands}</h1>
    </div>
  )
}

export default ExerciseBrandFilter
